package java24;

public class Switching {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
 int test = 9;
 
 switch (test)	{
 case 1:	
	 System.out.println("Amo");
	 break;
 case 2:
	 System.out.println("Bots");
	 break;
	
 case 10: 
	 System.out.println("Correct 10");
	 break;
	
 default:
	 System.out.println("This is default");
 
 }
	}

}
